script: |
  super -f text -I q10336.spq | sort > q10336.out

inputs:
  - name: q10336.spq
    data: |
      SELECT DISTINCT col2 * col0 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE - col1 NOT BETWEEN col0 * col1 + + col0 AND - col2 - + col0 OR ( col1 ) > ( + col0 );
  - name: tab2

outputs:
  - name: q10336.out
    data: |
      189
      2028
      3002
